import React from 'react';
import ReactDOM from 'react-dom';

class Signout extends React.Component {
    render() {
        return (
            ReactDOM.render(
                <React.StrictMode>
                  <LoginPage />
                </React.StrictMode>,
                document.getElementById('root')
            )
        );
    }
}

export default Signout;
